void pollKeyboard()
{
    volatile int *PS2_ptr = (int *)PS2_BASE;
    int PS2_data = *(PS2_ptr); // get value of PS2 data register
    // printf("%d\n", PS2_data);
    int RVALID = PS2_data & RVALID_BIT; // get only the RVALID bit
    if (RVALID != 0)
    {
        // shift values queue back and add newest keypress to front
        keyboard_keys.last_last_key = keyboard_keys.last_key;
        keyboard_keys.last_key = keyboard_keys.key;
        char temp_key = PS2_data & PS2_DATA_BITS;
        // if key is valid, add to structure, if not add "not valid" character instead
        // printf("%x\n", temp_key);
        if (isValidKey(temp_key))
            keyboard_keys.key = temp_key;
        else
            keyboard_keys.key = KEY_NOT_VALID;

        if ((keyboard_keys.key == KEY_W && keyboard_keys.last_last_key == KEY_NULL))
        { // IF W IS PRESSED (decrease current round difficulty)
            if (RoundDifficulty < 5)
                RoundDifficulty++;
            writeRoundDifficulty();
            // else do nothing
            // printf("Round Difficulty: %d\n", RoundDifficulty);
        }
        else if (keyboard_keys.key == KEY_SPACE && keyboard_keys.last_last_key == KEY_NULL && gameStart && !doneGame)
        {
            playAudio(SongsSamples[Round - 1], SongsSamplesLen[Round - 1] * RoundDifficulty / 5);
        }
        else if (keyboard_keys.key == KEY_ENTER && keyboard_keys.last_last_key == KEY_NULL && SelectedAnswer != -1)
        { // IF ENTER IS PRESSED (submit answer / next round)
            submitAnswer(SelectedAnswer - 1);
            writeAnswersAndSelected();
            writeRoundDifficulty();
            // printf("New Score: %d\n", PlayerScore);

            writeRoundAndScore(0);
        }
        else if (!doneGame && keyboard_keys.key == KEY_1 && keyboard_keys.last_last_key == KEY_NULL)
        {
            SelectedAnswer = 1;
            writeAnswersAndSelected();
        }
        else if (!doneGame && keyboard_keys.key == KEY_2 && keyboard_keys.last_last_key == KEY_NULL)
        {
            SelectedAnswer = 2;
            writeAnswersAndSelected();
        }
        else if (!doneGame && keyboard_keys.key == KEY_3 && keyboard_keys.last_last_key == KEY_NULL)
        {
            SelectedAnswer = 3;
            writeAnswersAndSelected();
        }
        else if (!doneGame && keyboard_keys.key == KEY_4 && keyboard_keys.last_last_key == KEY_NULL)
        {
            SelectedAnswer = 4;
            writeAnswersAndSelected();
        }
    }
}

void swap(int *a, int *b)
{
    int temp = *a;
    *a = *b;
    *b = temp;
}

void drawLine(int x0, int y0, int x1, int y1, short int colour)
{
    bool is_steep = abs(y1 - y0) > abs(x1 - x0);
    if (is_steep)
    {
        swap(&x0, &y0);
        swap(&x1, &y1);
    }
    if (x0 > x1)
    {
        swap(&x0, &x1);
        swap(&y0, &y1);
    }
    int deltax = x1 - x0;
    int deltay = abs(y1 - y0);

    int error = -(deltax / 2);
    int y = y0;

    int y_step;
    if (y0 < y1)
        y_step = 1;
    else
        y_step = -1;

    for (int x = x0; x < x1; x++)
    {
        if (is_steep)
            plotPixel(y, x, colour);
        else
            plotPixel(x, y, colour);
        error += deltay;
        if (error > 0)
        {
            y += y_step;
            error -= deltax;
        }
    }
}

void wait_for_vsync()
{
    volatile int *fbuf = (int *)0xFF203020; // base of VGA controller
    int status;
    *fbuf = 1;            // enable swap
    status = *(fbuf + 3); // read status register
    while (status & 1)
    { // wait until we poll status = 0
        status = *(fbuf + 3);
    }
}

// Function to plot the start menu at position (0,0)
void plot_image_menu(int x, int y)
{
    for (int i = 0; i < 240; i++)
    {
        for (int j = 0; j < 320; j++)
        {
            plotPixel(x + j, y + i, startMenu[i * 320 + j]);
        }
    }
}

void plot_album(int x, int y, int albNum)
{
    for (int i = 0; i < 60; i++)
    {
        for (int j = 0; j < 60; j++)
        {
            if (albNum == 1)
                plotPixel(x + j, y + i, bully_px[i * 60 + j]);
            else if (albNum == 2)
                plotPixel(x + j, y + i, grad_px[i * 60 + j]);
            else if (albNum == 3)
                plotPixel(x + j, y + i, yeezus_px[i * 60 + j]);
        }
    }
}

void erase_album(int x, int y)
{
    for (int i = 0; i < 60; i++)
    {
        for (int j = 0; j < 60; j++)
        {
            plotPixel(x + j, y + i, 0);
        }
    }
}

void plot_image_end(int x, int y, int type)
{
    for (int i = 0; i < 80; i++)
    {
        for (int j = 0; j < 100; j++)
        {
            if (type == 5)
                plotPixel(x + j, y + i, end_5[i * 100 + j]);
        }
    }
}

// timer setup code
// timer set up functions
void timerSetup(int counter_delay)
{
    *TIMER_STATUS = 0;
    *TIMER_START_LOW = counter_delay & 0XFFFF;
    *TIMER_START_HIGH = (counter_delay >> 16) & 0XFFFF;
    *TIMER_CONTROL = 0b0110; // enables continuous mode and starts the timer
}

bool pollTimer()
{
    while (!(*TIMER_STATUS & 0b1))
    {
        // checks the timeout bit
        return false; // timer hasn't expired
    }
    *TIMER_STATUS = 0; // clears TO bit
    return true;       // indicates that the timer expired
}

// high_scores
void updateHighScore(int highscore)
{
    // doesnt need to sort; all 0s so we just go down the list
    for (int i = 4; i >= 0; i--)
    {
        if (highscore > high_scores[i])
        {
            high_scores[i] = highscore;
        }
    }
}

